var loadingInstant = false;
var instantInterval = null;

function TwentyPercentCooleriOS() {
	var retina = window.devicePixelRatio >= 2;
	if (loadingInstant) {
		if (document.getElementById("sfcnt") == null) {
			return;
		}
		clearInterval(instantInterval);
		loadingInstant = false;
	}

	if (navigator.userAgent.match(/iP(hone|od)/i)) {
		var GoogleLogoMobileiPhone = document.getElementById("hplogoo");
		var searchLogoMobileiPhone = document.getElementById("mlogo");

		if (GoogleLogoMobileiPhone != null) {
			GoogleLogoMobileiPhone.innerHTML = '<img id="hplogo" src="data:image/png;base64," width="183" alt="">';
		}
		if (searchLogoMobileiPhone != null) {
			searchLogoMobileiPhone.setAttribute("style","background:url(data:image/png;base64,) no-repeat;background-size:74px 31px;height:31px;left:16px;position:absolute;top:3px;width:74px");
		}
		if (retina && GoogleLogoMobileiPhone != null) {
			GoogleLogoMobileiPhone.innerHTML = '<img id="hplogo" src="data:image/png;base64," width="183" alt="">';
		}
		if (retina && searchLogoMobileiPhone != null) {
			searchLogoMobileiPhone.setAttribute("style","background:url(data:image/png;base64,) no-repeat;background-size:74px 31px;height:31px;left:16px;position:absolute;top:3px;width:74px");
		}
	}
	if (navigator.userAgent.match(/iPad/i)) {
		var GoogleLogoMobileiPad = document.getElementById("hplogo");
		var searchLogoMobileiPad = document.getElementById("logocont");

		if (GoogleLogoMobileiPad != null) {
			GoogleLogoMobileiPad.innerHTML = '<img id="hplogo" src="data:image/png;base64," style="width:551px;height:234px;margin-top:-7px;margin-left:1px" alt="" />';
		}
		if (searchLogoMobileiPad != null) {
			searchLogoMobileiPad.innerHTML = '<h1><a id="logo" style="background:url(data:image/png;base64,) no-repeat;background-size:95px 40px;height:40px;left:12px;position:absolute;margin-top:12px;width:95px;display:block" title="/)^3^(\\" href="/webhp"></a></h1>';
		}
	}
}

window.addEventListener("hashchange", TwentyPercentCooleriOS, false);
if (window.location.hash != "") {
	loadingInstant = true;
	instantInterval = setInterval(TwentyPercentCooleriOS, 100);
}

TwentyPercentCooleriOS();
